   "Abstract" : "Chipotle Mexican Grill, Inc., often known simply as Chipotle, is an American multinational chain of fast casual restaurants specializing in bowls, tacos, and Mission burritos made to order in front of the customer. As of March 31, 2025, Chipotle has nearly 3,800 restaurants. Its name derives from chipotle, the Nahuatl name for a smoked and dried jalape\u00f1o chili pepper. Chipotle was one of the first chains of fast casual restaurants. It was founded by Steve Ells on July 13, 1993. Ells was the founder, chairman, and CEO of Chipotle. He was inspired to open the restaurant after visiting taquerias and burrito shops in San Francisco's Mission District while working as a chef. Ells wanted to show customers that fresh ingredients could be used to quickly serve food. Chipotle had 16 restaurants when McDonald's Corporation became a major investor in 1998. By the time McDonald's fully divested itself from Chipotle in 2006, the chain had grown to over 500 locations.",
   "AbstractSource" : "Wikipedia",
